(1, 1, 'Một người bình luận WordPress', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2018-07-16 02:52:12', '2018-07-16 02:52:12', 'Xin chào, đây là một bình luận\nĐể bắt đầu với quản trị bình luận, chỉnh sửa hoặc xóa bình luận, vui lòng truy cập vào khu vực Bình luận trong trang quản trị.\nAvatar của người bình luận sử dụng <a href=\"https://gravatar.com\">Gravatar</a>.', 0, '1', '', '', 0, 0),
(2, 282, 'bekteaft', 'bekteaft@opno.life', 'http://www.neverwinterhub.com/forum/viewtopic.php?f=12&amp;t=6290', '185.36.102.114', '2017-12-09 12:09:51', '2017-12-09 12:09:51', 'Hello, I also would like to share my view at this time, when i dont know even about a straightforward thing related to PHP, I always go to look for that from internet. \n<a href=\"http://www.ma3da.ru/forum/viewtopic.php?p=649871#649871\" rel=\"nofollow\">http://ksjantar.prv.pl/viewtopic.php?p=1553#1553</a>', 0, '0', '', '', 0, 0),
