(1, 'iywuqk-kajoft-spgkqu-adyqkl-jogweb', '0', 'Post Notification', '2018-08-09 14:33:40', '2018-08-09 14:33:41', 1, 'Hello {{NAME}},<br /><br />We have published a new blog article on our website : Chào tất cả mọi người!<br /><br /><br />You can view it from this link : <a href=\'http://localhost:9999/softwares/starComputer/star_ecommerce/web-tinhocngoisao/2018/07/16/chao-moi-nguoi/\' target=\'_blank\'>http://localhost:9999/softwares/starComputer/star_ecommerce/web-tinhocngoisao/2018/07/16/chao-moi-nguoi/</a><br /><br />Thanks & Regards,<br />Admin<br /><br />You received this email because in the past you have provided us your email address : {{EMAIL}} to receive notifications when new updates are posted.', 'Sent', 'Immediately', 'New Post Published - Chào tất cả mọi người!'),
(2, 'wdfozy-dgzwkn-jswpmu-igvbjr-skocax', '0', 'Newsletter', '2018-08-09 14:33:42', '2018-08-09 14:33:43', 1, '<strong style=\"color: #990000\">What can you achieve using Email Subscribers?</strong><p>Add subscription forms on website, send HTML newsletters & automatically notify subscribers about new blog posts once it is published. You can also Import or Export subscribers from any list to Email Subscribers.</p> <strong style=\"color: #990000\">Plugin Features</strong><ol> <li>Send notification emails to subscribers when new blog posts are published.</li> <li>Subscribe form available with 3 options to setup.</li> <li>Double Opt-In and Single Opt-In support.</li> <li>Email notification to admin when a new user signs up (Optional).</li> <li>Automatic welcome email to subscriber.</li> <li>Auto add unsubscribe link in the email.</li> <li>Import/Export subscriber emails to migrate to any lists.</li> <li>Default WordPress editor to create emails.</li> </ol> <strong>Thanks & Regards,</strong><br>Admin', 'Sent', 'Immediately', 'Welcome To Email Subscribers');
